import React from 'react';
import '../styles/components.css';

const About: React.FC = () => {
    return (
        <section className="about">
            <h2>About Me</h2>
            <p>
                Hello! I'm a passionate developer with a love for creating engaging and interactive web applications. 
                My journey in tech started with a fascination for video games, which inspired me to learn programming 
                and design. I have experience in various technologies and enjoy tackling challenging problems.
            </p>
            <h3>Skills</h3>
            <ul>
                <li>JavaScript / TypeScript</li>
                <li>React</li>
                <li>CSS / SASS</li>
                <li>Node.js</li>
                <li>Game Development</li>
            </ul>
        </section>
    );
};

export default About;
